import React, { useState} from "react";

const Table = ({ cards }) => {
  return (
    <div>
      <table border='1'>
        <tr>
          <th>N/N</th>
          <th>Name</th>
          <th>Price</th>
          <th>Speed</th>
          <th>Buttons</th>
        </tr>
        {cards.map((card) => {
          return <TableRow rowData={card} key={card.id} />;
        })}
      </table>
    </div>
  );
};

export default Table;

const TableRow = ({ rowData }) => {
  const { id, english, russian, transcription } = rowData;
  const [isSelected, setIsSelected] = useState(false);
  const [value, setValue] = useState({
    id:id,
    english:english,
    russian:russian,
    transcription:transcription,
  });


  function handleClose() {
    setIsSelected(!isSelected);
    setValue({ ...rowData });
  }
  function handleSave() {
    setValue({...value});
    setIsSelected(!isSelected);
  }

  function handleEdit() {
    setIsSelected(!isSelected);
  }

  function handleChange(event) {
    setValue((prevValue) => {
      return { ...prevValue, [event.target.english]: event.target.russian };
    });
  }
 
  return isSelected ? (
    <tr>
      <td>
        <td>{id}</td>
      </td>
      <td>
        <input
          type='text'
          value={value.english}
          name={'english'}
          onChange={handleChange}
        />
      </td>
      <td>
        <input
          type='text'
          value={value.russian}
          name={'russian'}
          onChange={handleChange}
        />
      </td>

      <td>
        <input
          type='text'
          value={value.transcription}
          name={'transcription'}
          onChange={handleChange}
        />
      </td>
      <button onClick={handleSave}>Save</button>
      <button onClick={handleClose}>Close</button>
    </tr>
  ) : (
    <tr>
      <td>{id}</td>
      <td>{value.e}</td>
      <td>{value.price}</td>
      <td>{value.speed}</td>
      <td>
        <td>
          <button onClick={handleEdit}>Edit</button>
          <button>Delete</button>
        </td>
      </td>
    </tr>
  );
};



const CardWrapper=()=>{

  
  return(
    <>
    <button>Next</button>
    <Card />
    <button>Previous</button>
    
    </>
  )
}




const Card =({english})=>{
  return(
    <div>{english}</div>
  )
}
